import styled from 'styled-components'
import Sizing from './Sizing'

const Div = styled.div`
    border-style: solid;
    height: 95%;
`;

const Content = ({ activePage }) => {
    return (
        <Div>
            {activePage === 'Sizing' && <Sizing />}
        </Div>
    )
}

export default Content
